//Abstract syntax types generated by rustlr for grammar prop
    
#![allow(unused_variables)]
#![allow(non_snake_case)]
#![allow(non_camel_case_types)]
#![allow(unused_parens)]
#![allow(unused_imports)]
#![allow(dead_code)]
extern crate rustlr;
use rustlr::LBox;
use fixedstr::str4;

#[derive(Debug)]
pub enum Prop {
  Not(LBox<Prop>),
  And(LBox<Prop>,LBox<Prop>),
  Or(LBox<Prop>,LBox<Prop>),
  Var(str4),
  Implies(LBox<Prop>,LBox<Prop>),
  Prop_5(LBox<Prop>),
  Prop_Nothing,
}
impl Default for Prop { fn default()->Self { Prop::Prop_Nothing } }

